package br.com.elvisassis.msclientes.domain;import br.com.elvisassis.msclientes.dto.ClientDTO;import jakarta.persistence.*;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;@Entity@Table@Getter@Setter@AllArgsConstructor@NoArgsConstructorpublic class Client {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    @Column(name = "cpf", unique = true)    private String cpf;    @Column(name = "name")    private String name;    @Column(name = "age")    private String age;    public Client(String cpf, String name, String age) {        this.cpf = cpf;        this.name = name;        this.age = age;    }    public ClientDTO toDto(Client client) {        return new ClientDTO(client);    }}